import './App.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component } from 'react';

class App extends Component {
render() {
  return (
    <div className="App">
      <header className="App-header">
        <Button> Submit </Button>
     </header>
    </div>
  );
}
}
export default App;
